description:
Promotional info for the collected edition - &quot;As the Human Torch and Lyja discuss the merits of leaving the F5 to form their own team and Sharon Ventura returns to confront her ex-husband the Thing, the real Doctor Doom returns with cosmic-like power and a thirst for revenge on Reed Richards and the Sub-Mariner! Also starring the Invisible Woman, Psi-Lord and Kristoff - and cameos galore! &quot;

Thanks to GreenGiant-DCP for the excellent scans. Please seed and enjoy. 

